import React from 'react';
import MakeList from './MakeList.js';

export default class App extends React.Component{
    constructor(props){
        super(props);

        this.state = {isListActive: true};
        this.handleClick = this.handleClick.bind(this);
    }

    render(){
        const list = [1,2,3,4];
        return (
            <MakeList list = {list} onClick={this.handleClick} />
        );
    }

    handleClick(e){
        this.setState({
            isListActive: !this.state.isListActive
        })
        console.log();
        
    }
}
